import {Nav} from "react-bootstrap";
import PlaylistAddIcon from '@mui/icons-material/PlaylistAdd';
import FavoriteIcon from '@mui/icons-material/Favorite';
import AnnouncementIcon from '@mui/icons-material/Announcement';
import Diversity3Icon from '@mui/icons-material/Diversity3';
import NewReleasesIcon from '@mui/icons-material/NewReleases';
import PersonIcon from '@mui/icons-material/Person';
import Container from "react-bootstrap/Container";

export default function Sidebar() {
    const navLinkClass = "list-group-item list-group-item-action list-group-item-light p-3";
    const linkPages = [{name: "Explore", icon: <NewReleasesIcon/>, to: '/'}, {
        name: "News",
        icon: <AnnouncementIcon />,
        to: '/'
    }, {
        name: "Profile",
        icon: <PersonIcon/>,

        to: '/'
    }, {name: "Friend", icon: <Diversity3Icon/>, to: '/'},
        {name: "Subsription", icon: <FavoriteIcon/>, to: '/'},
    ];

    return (
        <div className="border-end bg-white h-100  position-fixed" id="sidebar-wrapper">

            <Nav className="list-group list-group-flush  h-100">
                {linkPages.map(nav => {
                    return (
                        <Nav.Link className={navLinkClass}>
                            <Container className=" d-flex">
                                <Container className="flex-grow-1">
                                    {nav.icon}
                                </Container>
                                <Container className="flex-grow-3 ">
                                    {nav.name}
                                </Container>

                            </Container>
                        </Nav.Link>
                    );
                })}

            </Nav>
        </div>
    );
}
